const ToolMain = (props) => {
  return <div {...props}>
    <section>
      <header>
        <h1>도구들</h1>
        <p>내가 <del>가지고 놀려고</del> 쓰려고 만든 도구들</p>
      </header>
    </section>
  </div>;
}

export { ToolMain };
